import React from "react";

import NavigationItem from "./NavigationItem/NavigationItem";

type Props = { direction: string };

const NavigationItems = ({ direction }: Props) => (
  <ul>
    <NavigationItem link="/" exact={true}>
      Dashboard
    </NavigationItem>
    <NavigationItem exact={false} link="/users">
      Users
    </NavigationItem>
    <NavigationItem exact={false} link="/services">
      Services
    </NavigationItem>
  </ul>
);

export default NavigationItems;
